import './App.css';
import {useState, useEffect} from 'react';


function App() {

  const [mOrders, setOrders] = useState([]);

  useEffect(() => {

      fetch('http://localhost:5000/rapi/v1/orders', {
        'methods' : 'GET',
        headers: {
          'Content-Type':'application/json'
        }
      })
      .then(resp => resp.json())
      .then(resp => setOrders(resp))
      .catch(error => console.log(error))

  }, [])

  return (
    <div className="App">

      <h1> Flask & React</h1>

      {mOrders.map(order => {
        return (
          <div key = {order.productID}>
            <h2>Manufacture Orders</h2>
            <h2>{order.quantity}</h2>
            <h2>{order.notes}</h2>

          </div>
        )
      })}

    </div>
  );
}

export default App;
